      active_lock_reason: null,
      body: '\n## Version **1.14.42** of [ccxt](https://github.com/ccxt/ccxt) was just published.\n\n<table>\n  <tr>\n    <th align=left>\n      Branch\n    </th>\n    <td>\n      <a href="https://github.com/coinolio/coinolio/compare/master...coinolio:greenkeeper%2Fccxt-1.14.42">Build failing üö®</a>\n    </td>\n  </tr>\n  <tr>\n    <th align=left>\n      Dependency\n    </td>\n    <td>\n      <code>ccxt</code>\n    </td>\n  </tr>\n  <tr>\n    <th align=left>\n      Current Version\n    </td>\n    <td>\n      1.14.41\n    </td>\n  </tr>\n  <tr>\n    <th align=left>\n      Type\n    </td>\n    <td>\n      dependency\n    </td>\n  </tr>\n</table>\n\nThis version is **covered** by your **current version range** and after updating it in your project **the build failed**.\n\n\nccxt is a direct dependency of this project, and **it is very likely causing it to break**. If other packages depend on yours, this update is probably also breaking those in turn.\n\n\n\n<details>\n<summary>Status Details</summary>\n\n- ‚ùå **continuous-integration/travis-ci/push** The Travis CI build could not complete due to an error [Details](https://travis-ci.org/coinolio/coinolio/builds/381613499?utm_source=github_status&utm_medium=notification)\n</details>\n\n\n---\n\n<details>\n<summary>Commits</summary>\n<p>The new version differs by 2 commits.</p>\n<ul>\n<li><a href="https://urls.greenkeeper.io/ccxt/ccxt/commit/13e06b5ec10ac9edc581d8930687bbacd1f8d02d"><code>13e06b5</code></a> <code>1.14.42</code></li>\n<li><a href="https://urls.greenkeeper.io/ccxt/ccxt/commit/81687420f7c0d735128c1bbdeafd2cf38ae9cc39"><code>8168742</code></a> <code>cobinhood handling for InvalidNonce fix #2867</code></li>\n</ul>\n<p>See the <a href="https://urls.greenkeeper.io/ccxt/ccxt/compare/6e6f67de7f0ac0d7e3c3523eb77fdfe36299e492...13e06b5ec10ac9edc581d8930687bbacd1f8d02d">full diff</a></p>\n</details>\n\n\n<details>\n<summary>FAQ and help</summary>\n\nThere is a collection of [frequently asked questions](https://greenkeeper.io/faq.html). If those don‚Äôt help, you can always [ask the humans behind Greenkeeper](https://github.com/greenkeeperio/greenkeeper/issues/new).\n</details>\n\n---\n\n\nYour [Greenkeeper](https://greenkeeper.io) Bot :palm_tree:\n',
